import { Bot, Settings, Wifi, WifiOff } from 'lucide-react';

const Header = ({ isConnected, onSettingsClick }) => {
  return (
    <header className="bg-white border-b border-neutral-200 shadow-sm sticky top-0 z-50 backdrop-blur-sm bg-white/95">
      <div className="px-6 py-4">
        <div className="flex justify-between items-center">
          {/* Logo and Brand - Enhanced with gradient */}
          <div className="flex items-center space-x-4">
            <div className="flex items-center justify-center w-12 h-12 bg-gradient-to-br from-brand-500 to-brand-700 rounded-xl shadow-lg">
              <Bot className="w-7 h-7 text-white" />
            </div>
            <div>
              <h1 className="text-2xl font-bold bg-gradient-to-r from-brand-600 to-brand-800 bg-clip-text text-transparent">
                AI Agent Orchestration Hub
              </h1>
              <p className="text-sm text-neutral-600 font-medium">
                Enterprise Multi-Agent Intelligence Platform
              </p>
            </div>
          </div>

          {/* Right side - Enhanced styling */}
          <div className="flex items-center space-x-4">
            {/* Connection Status - Enhanced with animation */}
            <div className={`flex items-center space-x-3 px-4 py-2 rounded-full text-sm font-medium transition-all duration-300 shadow-sm border ${
              isConnected 
                ? 'bg-success-50 text-success-700 border-success-200 hover:bg-success-100' 
                : 'bg-error-50 text-error-700 border-error-200 hover:bg-error-100'
            }`}>
              {isConnected ? (
                <Wifi className="w-4 h-4" />
              ) : (
                <WifiOff className="w-4 h-4" />
              )}
              <div className="flex items-center space-x-2">
                <div className={`w-2 h-2 rounded-full ${
                  isConnected ? 'bg-success-500 animate-pulse' : 'bg-error-500'
                }`} />
                <span className="font-semibold">{isConnected ? 'Connected' : 'Disconnected'}</span>
              </div>
            </div>

            {/* Settings Button - Enhanced */}
            <button
              onClick={onSettingsClick}
              className="flex items-center justify-center w-10 h-10 bg-neutral-100 hover:bg-neutral-200 text-neutral-700 hover:text-neutral-900 rounded-lg transition-all duration-200 hover:shadow-md active:scale-95"
              title="Settings"
              aria-label="Open settings"
            >
              <Settings className="w-5 h-5" />
            </button>
          </div>
        </div>
      </div>
    </header>
  );
};

export default Header;
